widgets.css:
.pips {
  position:absolute;
  top:0;left:0;right:0;bottom:0;
  pointer-events:none;
  margin:var(--widget-spacing);
}
.pips .v {
  position:absolute;
  height:100%;
  border-left:1rem solid grey;
  opacity:0.25;
  padding-left:3rem;
  align-items: end;
  display:flex;
  line-height: 20rem;
}
.pips .v:first-child {
  border:none;
}
.pips .h {
  position:absolute;
  width:100%;
  border-top:1rem solid grey;
  opacity:0.25;
  padding-left:3rem;
  align-items: end;
  display:flex;
  line-height: 20rem;
}
